Δήλωση on camera του εκπροσώπου Τύπου του ΣΥΡΙΖΑ-Προοδευτική Συμμαχία
Η χθεσινή συνέντευξη ήταν ένα βατερλό για τον κ. Μητσοτάκη.
Προκειμένου να μην ομολογήσει την ενοχή του για τη χρήση του Predator, ισχυρίστηκε ότι κάποιος ιδιώτης το χρησιμοποιεί σε βάρος του μισού υπουργικού συμβουλίου και κάποια στιγμή θα τον βρει.
Άραγε με ποιο τρόπο;
Με το απόρρητο που έχει επιβάλει ή με την εντολή του να καταψηφίζει η πλειοψηφία τη κλήση του ιδιώτη στην Εξεταστική Επιτροπή για να καταθέσει;
Αλήθεια ποιον κοροϊδεύει ο κος Μητσοτάκης;

Για να τελειώνουν, όμως, τα ψέματα, περιμένουμε τον κο Μητσοτάκη τη Παρασκευή στη Βουλή να έρθει, ως οφείλει, για να απαντήσει στον κ. Τσίπρα εάν –και ποια- από τα 33 πρόσωπα που αποκαλύφθηκε ότι παρακολουθούνται με Predator ήταν και σε καθεστώς επίσημης επισύνδεσης από την ΕΥΠ, όπως οι κ.κ. Ανδρουλάκης και Κουκάκης.

Θες να φύγεις από το πατρικό σου;
