Δήλωση του αναπληρωτή εκπροσώπου Τύπου του ΣΥΡΙΖΑ-ΠΣ
Στενή συνεργάτιδα του ΠΘ, παρενέβη στον ΟΠΕΚΕΠΕ για να πληρωθούν συγκεκριμένοι αγρότες, αποκαλύπτει το in.gr και το MEGA.
«Χρειάζεται να πάρουμε τις εκλογές», τόνισε.
Είναι αλήθεια κ. Μητσοτάκη;
Ήταν δική σας εντολή;
Αν όχι, γιατί συγκαλύπτετε τους υπουργούς και τους  συνεργάτες σας;
Πείτε επιτέλους την αλήθεια για τα γαλάζια χωράφια και την  κλοπή εκ. ευρώ από τους έντιμους Έλληνες παραγωγούς.
